INSERT INTO rs_ceds7_sc.ref_item_response_theory_kappa_algorithm( Ref_Item_Response_Theory_Kappa_Algorithm_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Cohen''s unweighted algorithm', 'Cohen_Unweighted', 'Cohen''s unweighted algorithm is specified as the algorithm used to derive the Assessment Item Kappa Value.', null, 1.00 ); 
