INSERT INTO rs_ceds7_sc.ref_naep_aspects_of_reading( Ref_Naep_Aspects_Of_Reading_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Developing Interpretation', 'Developing_Interpretation', 'To develop an interpretation, the reader must extend initial impressions to arrive at a more complete understanding of what was read. This involves linking information across parts of a text as well as focusing on specific information.', null, 1.00 ); 
